void IdleText(char* time, float rTemp, float rHumidity) {

	char tem[50];
	char tempFloat[10];
	char hum[50];

	sprintf(tempFloat, "%.2f", rTemp);
	strcpy(tem, "Room Temp: ");
	strcat(tem, tempFloat);
	strcat(tem, " F");

	sprintf(tempFloat, "%.2f", rHumidity);
	strcpy(hum, "Room Humidity: ");
	strcat(hum, tempFloat);
	strcat(hum, "%");

	DrawText(50, 100, time, DARKPINK, WHITE, 3);
	DrawText(50, 140, tem, DARKPINK, WHITE, 3);
	DrawText(50, 180, hum, DARKPINK, WHITE, 3);

}
